bytes32 constant BANK = keccak256("Bank");

contract Bank is
    RepositoryContract,
    UIntConverter
{

    function id() public view returns (bytes32) {return BANK;}

    /////////////////////////////////////////////////////////////////////////////////////////
    //      event
    /////////////////////////////////////////////////////////////////////////////////////////
    event Transferred(
        bytes32 indexed currency_,
        address indexed from_,
        address indexed to_,
        uint256 amount_
    );
    event Stacked(
        bytes32 indexed currency_,
        address indexed account_,
        uint256 amount_
    );

    function _changed(bytes32 currency_, address account_) internal virtual {
        (bool success, bytes memory data) = address(rep).call(
            abi.encodeWithSelector(
                bytes4(keccak256("_changed(bytes32,address)")),
                currency_,
                account_
            )
        );
        require(success, "_changed");
    }

    using Array for address[];
    using Array for bytes32[];

    struct AccountMain64 {
        uint64 _balance;
        uint64 _reserve;
        uint64 _collateral;
        bool _opaque;
    }
    struct AccountExtra64 {
        uint64 _credit;
        uint64 _allowance;
        uint64 _collateralcredit;
        uint64 _collateralallowance;
    }
    struct Account64 {
        //2x256bits
        AccountMain64 m;
        AccountExtra64 e;
    }
    struct Account {
        uint256 _balance;
        uint256 _reserve;
        uint256 _collateral;
        uint256 _credit;
        uint256 _allowance;
        uint256 _collateralcredit;
        uint256 _collateralallowance;
        uint256 _available;
        uint256 _unstackable;
        uint256 _creditused;
        uint256 _creditavailable;
    }

    /////////////////////////////////////////////////////////////////////////////////////////
    //      constructor
    /////////////////////////////////////////////////////////////////////////////////////////
    constructor(Repository rep_) RepositoryContract(rep_) {}

    function granularity(uint256 granularity_)
        public
        pure
        returns (uint256 out_)
    {
        out_ = UInt64ToUInt256(UInt256ToUInt64(granularity_));
        if (out_ == 0) out_ = UInt64ToUInt256(1);
    }
    function granularity(bytes32 tokenhash_)
        public
        view
        virtual
        returns (uint256)
    {
        return granularity(rep.granularity(tokenhash_));
    }
