    /////////////////////////////////////////////////////////////////////////////////////////
    //      storage
    /////////////////////////////////////////////////////////////////////////////////////////

    address[] private _holders;
    mapping(bytes32 => uint256) private _credits; // bytes32 is keccak(token,id)
    bool private _stopcredit;
    mapping(bytes32 => Account64) private _accounts; // bytes32 is keccak(keccak(token,id),account))

    function _available64(bytes32 currency_, address account_)
        internal
        view
        returns (uint64)
    {
        Account64 memory _account = _accounts[
            BytesAndKeccakLib.pureBytes32Address(currency_, account_)
        ];
        if (_stopcredit) return _account.m._balance;
        return _account.m._balance + _creditAvailable64(currency_, account_);
    }

    function available(bytes32 currency_, address account_)
        public
        view
        returns (uint256)
    {
        return UInt64ToUInt256(_available64(currency_, account_));
    }

    function _unstackable64(bytes32 currency_, address account_)
        internal
        view
        returns (uint64)
    {
        Account64 memory _account = _accounts[
            BytesAndKeccakLib.pureBytes32Address(currency_, account_)
        ];
        if (
            (_creditUsed64(currency_, account_) > 0) ||
            (_account.m._collateral > _account.m._balance)
        ) return 0;
        return _account.m._balance - _account.m._collateral;
    }

    function _creditUsed64(bytes32 currency_, address account_)
        internal
        view
        returns (uint64)
    {
        Account64 memory _account = _accounts[
            BytesAndKeccakLib.pureBytes32Address(currency_, account_)
        ];
        return _account.e._credit + _account.e._collateralcredit;
    }

    function _creditAvailable64(bytes32 currency_, address account_)
        internal
        view
        returns (uint64)
    {
        if (_stopcredit) return 0;
        Account64 memory _account = _accounts[
            BytesAndKeccakLib.pureBytes32Address(currency_, account_)
        ];
        if (
            _creditUsed64(currency_, account_) >
            _account.e._allowance + _account.e._collateralallowance
        ) return 0;
        return
            _account.e._allowance +
            _account.e._collateralallowance -
            _creditUsed64(currency_, account_);
    }

    function account(bytes32 currency_, address account_)
        external
        view
        returns (Account memory acc_)
    {
        Account64 storage _account = _accounts[
            BytesAndKeccakLib.pureBytes32Address(currency_, account_)
        ];
        require(
            (!_account.m._opaque) || (_msgSender() == account_),
            "Account is opaque"
        );

        acc_._balance = UInt64ToUInt256(_account.m._balance);
        acc_._reserve = UInt64ToUInt256(_account.m._reserve);
        acc_._collateral = UInt64ToUInt256(_account.m._collateral);
        acc_._credit = UInt64ToUInt256(_account.e._credit);
        acc_._allowance = UInt64ToUInt256(_account.e._allowance);
        acc_._collateralcredit = UInt64ToUInt256(_account.e._collateralcredit);
        acc_._collateralallowance = UInt64ToUInt256(
            _account.e._collateralallowance
        );
        acc_._available = UInt64ToUInt256(_available64(currency_, account_));
        acc_._unstackable = UInt64ToUInt256(
            _unstackable64(currency_, account_)
        );
        acc_._creditused = UInt64ToUInt256(_creditUsed64(currency_, account_));
        acc_._creditavailable = UInt64ToUInt256(
            _creditAvailable64(currency_, account_)
        );
    }

    function __balanceAdd(
        bytes32 currency_,
        address account_,
        uint256 amount__
    ) internal {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount != 0) {
            bytes32 _key = rep.Bytes32Address(currency_, account_);
            Account64 memory _account = _accounts[_key];
            bool creditchanged;
            if (_account.e._credit > 0) {
                if (_account.e._credit >= _amount) {
                    _account.e._credit -= _amount;
                    _credits[currency_] -= UInt64ToUInt256(_amount);
                    _amount = 0;
                } else {
                    _amount -= _account.e._credit;
                    _credits[currency_] -= UInt64ToUInt256(_account.e._credit);
                    _account.e._credit = 0;
                }
                creditchanged = true;
            }
            bool creditcollateralchanged;
            if (_account.e._collateralcredit > 0) {
                if (_account.e._collateralcredit >= _amount) {
                    _account.e._collateralcredit -= _amount;
                    _credits[currency_] -= UInt64ToUInt256(_amount);
                    _amount = 0;
                } else {
                    _amount -= _account.e._collateralcredit;
                    _credits[currency_] -= UInt64ToUInt256(
                        _account.e._collateralcredit
                    );
                    _account.e._collateralcredit = 0;
                }
                creditcollateralchanged = true;
            }
            bool balancechanged;
            if (_amount > 0) {
                _account.m._balance += _amount;
                balancechanged = true;
            }
            if ((creditchanged || creditcollateralchanged) && (!balancechanged))
                _accounts[_key].e = _account.e;
            else if (
                (!creditchanged) &&
                (!creditcollateralchanged) &&
                (balancechanged)
            ) _accounts[_key].m = _account.m;
            else _accounts[_key] = _account;
            _changed(currency_, account_);
        }
    }

    function __balanceSub(
        bytes32 currency_,
        address account_,
        uint256 amount__
    ) internal {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount != 0) {
            bytes32 _key = rep.Bytes32Address(currency_, account_);
            Account64 memory _account = _accounts[_key];

            require(
                (((!_stopcredit) &&
                    (_account.m._balance +
                        _creditAvailable64(currency_, account_) >=
                        _amount)) ||
                    ((_stopcredit) && (_account.m._balance >= _amount))),
                "Not enought balanceOf/credit allowance"
            );
            bool creditcollateralchanged;
            if (_amount > _account.m._balance) {
                uint64 _newcredit = _amount - _account.m._balance;
                uint64 _collateralcreditavail = _account
                    .e
                    ._collateralallowance - _account.e._collateralcredit;
                if (_newcredit > _collateralcreditavail)
                    _newcredit = _collateralcreditavail;
                _account.e._collateralcredit += _newcredit;
                _amount -= _newcredit;
                creditcollateralchanged = true;
            }
            bool creditchanged;
            if (_amount > _account.m._balance) {
                uint64 _newcredit = _amount - _account.m._balance;
                uint64 _creditavail = _account.e._allowance -
                    _account.e._credit;
                if (_newcredit > _creditavail) _newcredit = _creditavail;
                _account.e._credit += _newcredit;
                //_totalcredit+= _newcredit;
                _amount -= _newcredit;
                creditchanged = true;
            }
            bool balancechanged;
            if (_amount > 0) {
                _account.m._balance -= _amount;
                balancechanged = true;
            }
            if ((creditchanged || creditcollateralchanged) && (!balancechanged))
                _accounts[_key].e = _account.e;
            else if (
                (!creditchanged) &&
                (!creditcollateralchanged) &&
                (balancechanged)
            ) _accounts[_key].m = _account.m;
            else _accounts[_key] = _account;
            _changed(currency_, account_);
        }
    }

    function _reserveAdd(
        bytes32 currency_,
        address account_,
        address,
        uint256 amount__
    ) external onlyContracts {
        uint64 _amount = UInt256ToUInt64(amount__);

        if (_amount != 0) {
            bytes32 _key = rep.Bytes32Address(currency_, account_);
            Account64 memory _account = _accounts[_key];

            assert(_account.m._balance >= _amount);
            _account.m._reserve += _amount;
            _account.m._balance -= _amount;
            _accounts[_key].m = _account.m;
            _changed(currency_, account_);
        }
    }

    function _reserveSub(
        bytes32 currency_,
        address account_,
        address,
        uint256 amount__
    ) external onlyContracts {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount != 0) {
            bytes32 _key = rep.Bytes32Address(currency_, account_);
            Account64 memory _account = _accounts[_key];
            _account.m._reserve -= _amount;
            _account.m._balance += _amount;
            _accounts[_key].m = _account.m;
            _changed(currency_, account_);
        }
    }

    function _collateralAdd(
        bytes32 currency_,
        address account_,
        address,
        uint256 amount__
    ) external onlyContracts {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount != 0) {
            bytes32 _key = rep.Bytes32Address(currency_, account_);
            Account64 memory _account = _accounts[_key];
            _account.m._collateral += _amount;
            _accounts[_key].m = _account.m;
            _changed(currency_, account_);
        }
    }

    function _collateralSub(
        bytes32 currency_,
        address account_,
        address,
        uint256 amount__
    ) external onlyContracts {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount != 0) {
            bytes32 _key = rep.Bytes32Address(currency_, account_);
            Account64 memory _account = _accounts[_key];
            _account.m._collateral -= _amount;
            _accounts[_key].m = _account.m;
            _changed(currency_, account_);
        }
    }

    function _collateralAllowanceAdd(
        bytes32 currency_,
        address account_,
        address,
        uint256 amount__
    ) external onlyContracts {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount != 0) {
            bytes32 _key = rep.Bytes32Address(currency_, account_);
            Account64 memory _account = _accounts[_key];
            _account.e._collateralallowance += _amount;
            if (_account.e._credit > 0) {
                uint64 _tocollateral = _account.e._collateralallowance -
                    _account.e._collateralcredit;
                if (_account.e._credit < _tocollateral)
                    _tocollateral = _account.e._credit;
                _account.e._credit -= _tocollateral;
                _account.e._collateralcredit += _tocollateral;
            }
            _accounts[_key].e = _account.e;
            _changed(currency_, account_);
        }
    }

    function _collateralAllowanceSub(
        bytes32 currency_,
        address account_,
        address,
        uint256 amount__
    ) external onlyContracts {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount != 0) {
            bytes32 _key = rep.Bytes32Address(currency_, account_);
            Account64 memory _account = _accounts[_key];
            _account.e._collateralallowance -= _amount;
            if (
                _account.e._collateralcredit > _account.e._collateralallowance
            ) {
                uint64 _removecollateral = _account.e._collateralcredit -
                    _account.e._collateralallowance;
                _account.e._credit += _removecollateral;
                _account.e._collateralcredit -= _removecollateral;
            }
            _accounts[_key].e = _account.e;
            _changed(currency_, account_);
        }
    }

    function _allowanceAdd(
        bytes32 currency_,
        address account_,
        address,
        uint256 amount__
    ) external onlyContracts {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount != 0) {
            bytes32 _key = rep.Bytes32Address(currency_, account_);
            Account64 memory _account = _accounts[_key];
            _account.e._allowance += _amount;
            _accounts[_key].e = _account.e;
            _changed(currency_, account_);
        }
    }

    function _allowanceSub(
        bytes32 currency_,
        address account_,
        address,
        uint256 amount__
    ) external onlyContracts {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount != 0) {
            bytes32 _key = rep.Bytes32Address(currency_, account_);
            Account64 memory _account = _accounts[_key];
            _account.e._allowance -= _amount;
            _accounts[_key].e = _account.e;
            _changed(currency_, account_);
        }
    }

    /////////////////////////////////////////////////////////////////////////////////////////
    //      internal    public onlyContracts
    /////////////////////////////////////////////////////////////////////////////////////////

    function _transfer(
        bytes32 currency_,
        address accountfrom_,
        address accountto_,
        uint256 amount__
    ) public onlyContracts {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount == 0) return;

        require(!STOP(), "Contract stopped");
        bytes32 _keyfrom = rep.Bytes32Address(currency_, accountfrom_);
        bytes32 _keyto = rep.Bytes32Address(currency_, accountto_);
        require(
            _amount <= _available64(currency_, accountfrom_),
            "erc20 available(_accountfrom) < _amount"
        );

        _holders.insert(accountto_);
        __balanceSub(currency_, accountfrom_, UInt64ToUInt256(_amount));
        __balanceAdd(currency_, accountto_, UInt64ToUInt256(_amount));
        if ((!_accounts[_keyfrom].m._opaque) || (!_accounts[_keyto].m._opaque))
            emit Transferred(
                currency_,
                _accounts[_keyfrom].m._opaque ? address(0) : accountfrom_,
                _accounts[_keyto].m._opaque ? address(0) : accountto_,
                amount__
            );
    }

