    function stake(address token_, uint256 amount_) external payable all {
        if (token_ != address(0)) __stake(token_, 0, _msgSender(), amount_);
        if (msg.value > 0) __stake(address(0), 0, _msgSender(), msg.value);
    }

    function stake(
        address token_,
        uint256 tokenid_,
        uint256 amount_
    ) external payable all {
        if (token_ != address(0))
            __stake(token_, tokenid_, _msgSender(), amount_);
        if (msg.value > 0) __stake(address(0), 0, _msgSender(), msg.value);
    }

    function unstake(address token_, uint256 amount_) external all {
        __unstake(token_, 0, _msgSender(), amount_);
    }

    function unstake(
        address token_,
        uint256 tokenid_,
        uint256 amount_
    ) external all {
        __unstake(token_, tokenid_, _msgSender(), amount_);
    }

    function testStake(
        address token_,
        address account_,
        uint256 amount_
    ) external all {
        require(rep.MODETEST(), "Must be in Mode Testing");
        __stake(token_, 0, account_, amount_);
