    function __stake(
        address tokenaddr_,
        uint256 tokenid_,
        address account_,
        uint256 amount__
    ) private {
        require(
            tokenaddr_ != address(0) || tokenid_ == 0,
            "Currency is address(0),0"
        );
        bytes32 tokenhash = rep.currency(tokenaddr_, tokenid_);
        return __stake(tokenhash, account_, amount__);
    }

    function __stake(
        bytes32 tokenhash_,
        address account_,
        uint256 amount__
    ) private {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount == 0) return;

        require(!STOP(), "Contract stopped");

        //if (features(tokenhash_) != Token.TypeCurrency)
        /*if (rep.existsCurrency(tokenhash_)) {
            (address tokenAddr, uint256 tokenId) = rep.resolveCurrency(
                tokenhash_
            );
            rep.token(tokenAddr, tokenId);
        }*/

        if (rep.supportsInterface(tokenhash_,type(IBankeable).interfaceId)) 
            require(
                IBankeable(rep.resolveCurrencyAddr(tokenhash_)).bankeable(),
                "Token not bankeable"
            );

        //require(canEnter(token_), "Token isn't allowed in bank");

        if (!rep.MODETEST()) {
        if (rep.isFeatureType(tokenhash_,Token.TypeCurrency)) {} 
        else if (rep.isFeatureType(tokenhash_,Token.TypeERC20))
                IERC20(rep.resolveCurrencyAddr(tokenhash_)).transferFrom(
                    account_,
                    address(this),
                    UInt64ToUInt256(_amount)
                );
        }

        _holders.insert(account_);
        __balanceAdd(tokenhash_, account_, UInt64ToUInt256(_amount));
    }

    function __unstake(
        address tokenaddr_,
        uint256 tokenid_,
        address account_,
        uint256 amount__
    ) private {
        require(
            tokenaddr_ != address(0) || tokenid_ == 0,
            "Currency is address(0),0"
        );
        bytes32 tokenhash = rep.currency(tokenaddr_, tokenid_);
        return __unstake(tokenhash, account_, amount__);
    }

    function __unstake(
        bytes32 tokenhash_,
        address account_,
        uint256 amount__
    ) private {
        uint64 _amount = UInt256ToUInt64(amount__);
        if (_amount == 0) return;
        require(!STOP(), "Contract stopped");
        require(_unstackable64(tokenhash_, account_) >= _amount);

        if (!rep.MODETEST()) {
            if (rep.isFeatureType(tokenhash_,Token.TypeCurrency))
                payable(account_).transfer(amount__);
            else if (rep.isFeatureType(tokenhash_,Token.TypeERC20))
                IERC20(rep.resolveCurrencyAddr(tokenhash_)).transfer(account_, UInt64ToUInt256(_amount));
        }

        __balanceSub(tokenhash_, account_, UInt64ToUInt256(_amount));
    }
